import React from 'react'
import '../global_css/uploadPage_css/styles.css'


class UploadPage extends React.Component {
  render() {
    return (
      <div className="uploadPage">
        <h1 className="upload__title">Upload Video</h1>

        <div>
          <img src="/Assets/Images/Upload-video-preview.jpg" alt="" />
          TITLE YOUR VIDEO<input type="text" placeholder="Add title to your video"/>
          ADD A VIDEO DESCRIPTION<input type="text" placeholder="Add a description to your video" />
        </div>
      </div>
    )
  }
}

export default UploadPage;
